public class InnerDomainAdvancedSecurityOptionsInputFactory(Action<Humidifier.OpenSearchService.DomainTypes.AdvancedSecurityOptionsInput> factoryAction = null) : SubResourceFactory<Humidifier.OpenSearchService.DomainTypes.AdvancedSecurityOptionsInput>
{

    internal InnerDomainSAMLOptionsFactory SAMLOptionsFactory { get; set; }

    internal InnerDomainJWTOptionsFactory JWTOptionsFactory { get; set; }

    internal InnerDomainMasterUserOptionsFactory MasterUserOptionsFactory { get; set; }

    protected override Humidifier.OpenSearchService.DomainTypes.AdvancedSecurityOptionsInput Create()
    {
        var advancedSecurityOptionsInputResult = CreateAdvancedSecurityOptionsInput();
        factoryAction?.Invoke(advancedSecurityOptionsInputResult);

        return advancedSecurityOptionsInputResult;
    }

    private Humidifier.OpenSearchService.DomainTypes.AdvancedSecurityOptionsInput CreateAdvancedSecurityOptionsInput()
    {
        var advancedSecurityOptionsInputResult = new Humidifier.OpenSearchService.DomainTypes.AdvancedSecurityOptionsInput();

        return advancedSecurityOptionsInputResult;
    }
    public override void CreateChildren(Humidifier.OpenSearchService.DomainTypes.AdvancedSecurityOptionsInput result)
    {
        base.CreateChildren(result);

        result.SAMLOptions ??= SAMLOptionsFactory?.Build();
        result.JWTOptions ??= JWTOptionsFactory?.Build();
        result.MasterUserOptions ??= MasterUserOptionsFactory?.Build();
    }

} // End Of Class

